Sure, here's an example of Terraform code to create a new VM in AWS:

```hcl
provider "aws" {
  region = "us-east-1"
}

resource "aws_instance" "example" {
  ami           = "ami-0c55b159cbfafe1f0"
  instance_type = "t2.micro"
  key_name      = "my-key-pair"
  subnet_id     = "subnet-29fe24c6"
  tags = {
    Name = "example-instance"
  }
}
```

In this example, we're using the "aws" provider to specify AWS as the cloud provider, and then creating an "aws_instance" resource to define the new VM. We're specifying the AMI ID, instance type, key pair, subnet, and tags for the new VM. You would need to replace the placeholder values with your actual values based on your AWS environment.
